import React from "react";
import styled from "styled-components";

const StyledBlueTriangle = styled.img`
    height: 100vh;
    width: 100vw;
    position: absolute;
    top: 0;
    left: 0;
    z-index: -1;
`;

export {StyledBlueTriangle};
